// Local jsPDF shim (no-network) for TrailNote
// This file is intentionally minimal and does NOT load remote scripts to avoid CSP blocks.
// It exists only so the popup can attempt to load a local file without producing a file-not-found error.
(function(){
  try {
    // indicate that no native jsPDF is provided locally
    window.__TrailNote_jsPDF_available = false;
  } catch(e) {}
})();
